import React from "react";

function Navigation() {
  return (
    <header className="navbar font">
      <a href="mailto:giupi.deluca@hotmail.com" className="anchorNav">
        email me
      </a>

      <nav>
        <a href="#contact" className="anchorNav">
          <i className="fa fa-linkedin-square"></i>
        </a>

        <a
          href="https://github.com/GiupiDeLuca"
          target="_blank"
          className="anchorNav"
        >
          <i class="fa fa-github"></i>
        </a>
      </nav>
    </header>
  );
}

export default Navigation;
